import React from 'react';
import { useStyles } from "./Header.styles";

export const Header = () => {
  const styles = useStyles();

  return (
    <header className={styles.header}>
      <div className={styles.logoWrapper}>LOGO</div>
      <div className={styles.rateWrapper}>Rate</div>
    </header>
  );
};
